import React, { useState } from 'react';
import MenuIcon from '@mui/icons-material/Menu';
import styles from './styles/DropdownMenu.module.css';

function DropdownMenu() {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <div className={styles.menu}>
      <button onClick={toggleDropdown} className={styles.menuButton}>
        <MenuIcon />
      </button>
      {dropdownOpen && (
        <div className={styles.dropdown}>
          <a href="/organisations" className={styles.dropdownItem}>Organisations</a>
          <a href="/create-organisation" className={styles.dropdownItem}>Create Organisation</a>
          {/* Add more menu items as needed */}
        </div>
      )}
    </div>
  );
}

export default DropdownMenu;
